//Bootstrap
import Spinner from 'react-bootstrap/Spinner';

const Callback = () => {
    return (
        <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
            <div style={{display: 'flex-wrap', justifyContent: 'center'}}>
                <Spinner />
                <h1>Loading...</h1>
            </div>
        </div>
    )
}

export default Callback;
